import React from "react";

const Specialization = () => {
  return (
    <div className="p-4">
      <div className="text-center">
        <p className="text-primary font-medium">Expertise</p>
        <p className="font-bold text-xl">Our Specialization</p>
      </div>
      <div className="flex">
        <div className="w-72 h-72 drop-shadow-lg  bg-primary">
          <div className="h-44  bg-white rounded-b-lg drop-shadow-lg"></div>
        </div>
      </div>
    </div>
  );
};

export default Specialization;
